import React from "react";

function About() {
  return <>
   <div className="container con text-center my-5 ">
        <h1 style={{ color: "#e8762b" }}>What our Guests say about us?</h1>
        <h3>Every Review matters</h3>
        <hr />
      </div>
  </>;
}

export default About;
